import React from 'react'
import {
    Box, Paper, Button, makeStyles, Table, TableBody, TableCell,
    TableContainer, TableHead, TableRow, TableSortLabel
} from '@material-ui/core';
import data from './resources/names'


const useStyles = makeStyles({
    table: {
        width: "50%",
        padding: "20px 30px",

    },
    paper: {
        background: "white",
        padding: "20px 30px",
        margin: "0px 0px 50px 0px",
        width: "50%",
      },
});

export const NameTable = () => {

    const classes = useStyles;

    const names = data.names;

    console.log(names[0]);

    return (

        <Box height="90%" width="70%">
            <p>Name Application</p>

            <Paper className={classes.paper}>

                <TableContainer component={Paper}>
                    <Table className={classes.table} aria-label="simple table">
                        <TableHead>
                            <TableRow>
                                <TableCell>Name</TableCell>
                                <TableCell align="right">Amount</TableCell>
                            </TableRow>
                        </TableHead>
                        <TableBody>
                            {names.map((s, i) => (
                                <TableRow key={i}>
                                    <TableCell component="th" scope="row">
                                        {s.name}
                                    </TableCell>
                                    <TableCell align="right">{s.amount}</TableCell>
                                </TableRow>
                            ))}
                        </TableBody>
                    </Table>
                </TableContainer>

                <Button variant="contained" color="primary">
                    Order by name
    </Button>
    <Button variant="contained" color="primary">
                    Order by amount
    </Button>
            </Paper>
        </Box>
    );
};
